import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import MuiDialogTitle from '@material-ui/core/DialogTitle';
import MuiDialogContent from '@material-ui/core/DialogContent';
import MuiDialogActions from '@material-ui/core/DialogActions';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import Typography from '@material-ui/core/Typography';
import theme from '../theme';

const styles = (theme) => ({
    root: {
        margin: 0,
        padding: theme.spacing(5),
    },
    title: {
        fontWeight: 600,
        textAlign: 'center',
        paddingTop: '50px',
    },
    body: {
        fontSize: '16px',
    },
    closeButton: {
        position: 'absolute',
        right: theme.spacing(1),
        top: theme.spacing(1),
        color: '#251F1C',
    },
});


const DialogTitle = withStyles(styles)((props) => {
    const { children, classes, onClose, ...other } = props;
    return (
        <MuiDialogTitle disableTypography className={classes.title} {...other}>
            <Typography variant="h1">{children}</Typography>
            {onClose ? (
                <IconButton aria-label="close" className={classes.closeButton} onClick={onClose}>
                    <CloseIcon fontSize="large" />
                </IconButton>
            ) : null}
        </MuiDialogTitle>
    );
});

const DialogContent = withStyles((theme) => ({
    root: {
        padding: theme.spacing(2),

    },
    text: {
        fontSize: '16px',
    },
}))(MuiDialogContent);

const DialogActions = withStyles((theme) => ({
    root: {
        margin: 0,
        padding: theme.spacing(1),
    },
}))(MuiDialogActions);

export default function CustomizedDialogs() {
    const [open, setOpen] = React.useState(false);
    const classes = withStyles();

    const handleClickOpen = () => {
        setOpen(true);
    };
    const handleClose = () => {
        setOpen(false);
    };

    return (

        <div>
            <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                Open dialog
      </Button>
            <Dialog onClose={handleClose} open={open}>
                <DialogTitle onClose={handleClose}>
                    Some Important Terms
        </DialogTitle>
                <DialogContent >
                    <Typography variant="h6"> What is mutual aid?</Typography>
                    <Typography variant="p" className={classes.text} gutterBottom>

                        Mutual aid is when people get together to meet each other’s basic survival needs. Projects include: guerilla fundraising (mostly through cashapp/venmo), childcare/pretcare, language translators, and community fridges.
          </Typography>
                    <Typography gutterBottom>
                    <Typography variant="h6"> What are community fridges?</Typography>

                        Community fridges are a type of mutual aid project that address food-insecurity. They’re stocked with groceries by members of the community and can be accessed at no cost by anyone who needs food.
          </Typography>
                </DialogContent>
            </Dialog>
        </div>
    );
}
